import React from 'react'
import './main.css';
import { Row, Col } from 'react-bootstrap';
import learn from './images/Learnfast.jpg'

const Learn = () => {
    return(
        <div>
        <Row>
            <Col xs='12' md='6'>
                <img src={learn}  alt="learn"/>
            </Col>
            <Col xs='12' md='6'>
                Learn French
            </Col>
        </Row>
        </div>
    )
}

export default Learn;
